import React from 'react';
import { Layout } from 'antd';
import './App.css';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Navbar from './components/navbar';

const { Header } = Layout;

function App() {
	return (
		<Router>
			<Layout>
				<Header>
					<Navbar />
				</Header>
			</Layout>
		</Router>
	);
}

export default App;
